import React from "react";
import catHeader from "../../images/cat-header.png";

const Navbar = () => {
  return (
    <>
      <nav>
        <div className="">
          <img
            src={catHeader}
            alt="Cat Header "
            className="brightness-50 "
          />
        </div>
        <div className="absolute  top-0 left-0  flex items-center justify-center">
          <h1 className="text-3xl font-bold bg-orange-300 ">CatLy</h1>
          <ul className="flex  text-white items-center text-center">
            <li>Home</li>
            <li>About Us</li>
            <li>Contact</li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
